import styled from 'styled-components';

export const Form = styled.form`
  input {
    color: red;
  }
`;

export const Tbody = styled.tbody`
  td:nth-of-type(1) {
    width: 20%;
  }
  td:nth-of-type(2) {
    width: 15%;
  }
  td:nth-of-type(3) {
    width: 15%;
    text-align: center;
  }
  td:nth-of-type(4) {
    width: 15%;
    text-align: center;
  }
  td:nth-of-type(5) {
    width: 15%;
    text-align: center;
  }
  td:nth-of-type(6) {
    width: 5%;
    text-align: center;
  }
  td:nth-of-type(7) {
    width: 15%;
    text-align: center;
  }
`;
